import React from 'react'
import { Form, FormGroup } from 'reactstrap';

const AddCourse=()=>{

    return (
      <div>
        <h1 className="text-center" my-10>Fill Course Details</h1>
        <Form>
          <FormGroup>
            <label for="userId">Course Id</label>
            <input
              type="text"
              name="userId"
              id="userId"
              placeholder="Type Here"
            ></input>
          </FormGroup>
        </Form>
      </div>
    );
}

export default AddCourse;
